import React from 'react';
import styled from 'styled-components';

const Headline = styled.p`
  font-size: 24px;
  font-weight: 900;
  font-family: Helvetica Neue, Arial, sans-serif;
`;

export default function Card() {
  return <Headline>Card</Headline>;
}
